// index.js

import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './index.css';

import reportWebVitals from './reportWebVitals';
import { Provider } from 'react-redux';
import store from './redux/Store/index';
import { login, userProfile } from './redux/actions/all.actions'; // Importez l'action login et userProfile

// Lancez également l'action userProfile au démarrage de l'application
store.dispatch(userProfile());

// Récupérez l'e-mail et le mot de passe du localStorage
const email = localStorage.getItem('email');
const password = localStorage.getItem('password');

// Si l'e-mail et le mot de passe sont présents, appelez l'action login
if (email && password) {
  store.dispatch(login(email, password));
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Provider store={store}>
      <App />
    </Provider>
  </React.StrictMode>
);

// Mesurez les performances de votre application
reportWebVitals();
